import math

def find_kth_largest_prime(arr, k):

    def is_prime(n):
        if n <= 2:
            return False
        for i in range(2, int(math.sqrt(n)) + 1):
            if n % i == 0:
                return False
        return True
    primes = [num for num in arr if is_prime(num)]
    primes.sort(reverse=True)
    return primes[k - 1] if k <= len(primes) else None

